import React from 'react'
import styled from 'styled-components';
import Input from 'react-bootstrap/Input';

const Inputs = styled.input`
  width: 343px;
  height: 48px;
  background: #FFFFF;
  border-radius: 6px;
  border-color: #C1C1C1;
  box-shadow: none;
`;

class EmailField extends React.Component{
    render(){
        return(
        <Inputs/>
        )
    }
}
export default EmailField;
